import { UPLOAD_DATA } from "../actionType/actionType"

export const fetchData = async () => {
    try {
        let res = await fetch('https://opentdb.com/api.php?amount=10&token=789&category=10&difficulty=medium&type=multiple').Json()
        console.log(res)
    } catch (err) {
        console.error(err)
    }



}
